import { BrowserRouter, Route, Routes } from "react-router-dom";
import SwitchTabs from "./switchTabs";
import RegisterPage from "./registerPage";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<SwitchTabs/>}/>
                <Route path="/products" element={<RegisterPage/>}/>
            </Routes>
        </BrowserRouter>
    );
}
export default App;
